syntax = "proto3";

package v1.model;

import "google/protobuf/wrappers.proto";

option java_package = "v1.model";
option java_outer_classname = "BppTestCaseResultsProto";

message BppTestCaseResults {
   google.protobuf.Int32Value number_bins = 1;
   google.protobuf.DoubleValue average_tardiness_stored_items = 2;
   google.protobuf.DoubleValue seconds = 3;
}